import React, { useState, useRef } from "react";
import { motion, AnimatePresence } from "framer-motion";

const mindMapData = {
  label: "ME",
  color: "bg-lime-500",
  children: [
    {
      label: "Tech Stack",
      color: "bg-blue-400",
      children: [
        { label: "Java", color: "bg-blue-300" },
        { label: "JavaScript", color: "bg-blue-300" },
        { label: "HTML/CSS", color: "bg-blue-200" },
        { label: "Python", color: "bg-blue-200" },
        { label: "C#", color: "bg-blue-200" },
        { label: "Vue.js", color: "bg-blue-100" },
        { label: "Django", color: "bg-blue-100" }
      ]
    },
    {
      label: "Hobbies",
      color: "bg-orange-400",
      children: [
        {
          label: "Game",
          color: "bg-orange-300",
          children: [
            { label: "Diablo", color: "bg-orange-200" },
            { label: "Animal Crossing", color: "bg-orange-100" },
            { label: "Mine Craft", color: "bg-orange-100" }
          ]
        },
        {
          label: "Writing", color: "bg-orange-300",
          children: [
            { label: "Essay", color: "bg-orange-200" },
            { label: "Novel", color: "bg-orange-100" }
          ]
        },
        {
          label: "Listening Music",
          color: "bg-orange-300",
          children: [
            { label: "Classical Music", color: "bg-orange-200" },
            { label: "Jazz", color: "bg-orange-200" },
            { label: "K-pop", color: "bg-orange-100" }
          ]
        },
        { label: "Piano", color: "bg-orange-200" },
        { label: "Game Making", color: "bg-orange-100" },
        { label: "Caligraphy", color: "bg-orange-100" }
      ]
    },
    {
      label: "Languages",
      color: "bg-purple-700",
      children: [
        { label: "Korean ⭐⭐⭐", color: "bg-purple-600" },
        { label: "English ⭐⭐", color: "bg-purple-500" },
        { label: "Chinese ⭐⭐", color: "bg-purple-400" },
        { label: "Japanese ⭐", color: "bg-purple-300" }
      ]
    }
  ]
};

export default function MindMapPage() {
  const [path, setPath] = useState([]);
  const currentNode = path[path.length - 1] || mindMapData;
  const isRoot = path.length === 0;

  const mePosition = {
    x: window.innerWidth / 2 - 70,
    y: window.innerHeight / 2 - 150
  };

  const baseCenter = {
    x: window.innerWidth / 2 - 55,
    y: window.innerHeight / 2 - 130
  };

  const handleClick = (node) => {
    if (node === currentNode && path.length > 0) {
      setPath((prev) => prev.slice(0, -1));
    } else if (node.children) {
      node._origin = node._origin || { x: mePosition.x, y: mePosition.y };
      setPath((prev) => [...prev, node]);
    }
  };

  const baseCircleClass =
    "absolute rounded-full text-white text-center flex items-center justify-center transition-all duration-300 focus:outline-none";

  const shadowGlow =
    "shadow-xl hover:shadow-2xl filter drop-shadow-[0_0_12px_rgba(0,0,0,0.3)] dark:drop-shadow-[0_0_16px_rgba(255,255,255,0.45)]";

  const getRadialLayout = (count, radius = 140) => {
    const angleStep = (Math.PI * 2) / count;
    return Array.from({ length: count }, (_, i) => {
      const angle = angleStep * i - Math.PI / 2;
      return {
        x: baseCenter.x + Math.cos(angle) * radius,
        y: baseCenter.y + Math.sin(angle) * radius
      };
    });
  };

  const origin = path.length > 0 && currentNode._origin ? currentNode._origin : mePosition;

  return (
    <div className="relative w-screen h-screen bg-white dark:bg-gray-900 overflow-hidden">
      <motion.button
        key={currentNode.label + "-main" + path.length}
        initial={{ opacity: 0, scale: 0.9, left: origin.x, top: origin.y }}
        animate={{ opacity: 1, scale: 1, left: mePosition.x, top: mePosition.y }}
        transition={{ duration: 0.4 }}
        className={`w-28 h-28 ${currentNode.color} z-10 ${baseCircleClass} ${currentNode.children ? shadowGlow : ""}`}
        onClick={() => handleClick(currentNode)}
      >
        {currentNode.label}
      </motion.button>

      <AnimatePresence>
        {!isRoot &&
          currentNode.children &&
          getRadialLayout(currentNode.children.length).map((targetPos, i) => {
            const child = currentNode.children[i];
            child._origin = { x: targetPos.x, y: targetPos.y };
            const hasChildren = !!child.children;

            return (
              <motion.button
                key={child.label}
                initial={{ opacity: 0, scale: 0, x: 0, y: 0 }}
                animate={{
                  opacity: 1,
                  scale: 1,
                  x: targetPos.x - mePosition.x,
                  y: targetPos.y - mePosition.y
                }}
                exit={{ opacity: 0, scale: 0 }}
                transition={{ duration: 0.3, delay: i * 0.05 }}
                style={{ position: "absolute", left: mePosition.x, top: mePosition.y }}
                className={`w-20 h-20 ${child.color} ${baseCircleClass} ${hasChildren ? shadowGlow : ""}`}
                onClick={() => handleClick(child)}
              >
                {child.label}
              </motion.button>
            );
          })}
      </AnimatePresence>
    </div>
  );
}
